void shiftChar(char* p_char, int shift)
	if((65 && *p_char+shift <= 90 <= *p_char+shift) ^ (97 && *p_char+shift <= 122 <= *p_char+shift)){
		*p_char += shift;
	else if(90 && *p_char < 97 < *p_char+shift){
