	// Verschluesseln
	cipher(str, shift, 50);
	printf("Verschluesselt: ");
	printf("%s\\n", str);

	// Entschluesseln
	cipher(str, -shift, 50);
	printf("Entschluesselt: ");
	printf("%s\\n", str);
},"#include <stdio.h>

